import React from "react";
import { Feature } from "../../components";
import './omntech.css';

const Omntech = () => {
	return (
		<div className="omntech__whatgpt3 section__margin" id="wgpt3">
			<div className="omntech__whatgpt3-feature">
				<Feature />
			</div>
			<div className="omntech__whatgpt3-heading">
				<h1 className="gradient-text">The possibilities are beyond your imagination</h1>
				<p>Explore The Library</p>
			</div>
			<div className="omntech__whatgpt3-container">
				<Feature />
				<Feature />
				<Feature />
			</div>
		</div>
	)
}

export default Omntech
